import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// üß© Component Imports
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import About from "./components/About";
import Services from "./components/Services";
import Footer from "./components/Footer";
import AdminDashboard from "./components/AdminDashboard";
import CompanyProfile from "./components/CompanyProfile";

// üé® Global Colors
const SOFT_MINT = "#F5FFF9"; // Light mint background
const ARM_BLUE = "#1F3B66";  // Brand blue
const ARM_GOLD = "#D4A74B";  // Gold accent

// Helper to determine initial view
const getInitialView = () => {
  if (window.location.hash === "#admin-key-123") return "admin";
  return "public";
};

// ------------------------------------------------------------
// Page Transition Wrapper for fade animations
// ------------------------------------------------------------
const PageTransitionWrapper = ({ children, isPublic }) => {
  const [animate, setAnimate] = useState(false);
  useEffect(() => setAnimate(true), [isPublic]);
  return (
    <div
      className={`transition-opacity duration-500 ease-in-out ${
        animate ? "opacity-100" : "opacity-0"
      }`}
    >
      {children}
    </div>
  );
};

// ------------------------------------------------------------
// Public View (Home, About, Services, Footer)
// ------------------------------------------------------------
const PublicView = ({ toggleView, view }) => {
  return (
    <div className="bg-[#F5FFF9] min-h-screen">
      <Navbar handleNavigation={toggleView} currentView={view} />
      <main>
        <section id="hero">
          <Hero />
        </section>
        <section id="about">
          <About />
        </section>
        <section id="services">
          <Services />
        </section>
      </main>
      <Footer />
    </div>
  );
};

// ------------------------------------------------------------
// Main App Component
// ------------------------------------------------------------
export default function App() {
  const [view, setView] = useState(getInitialView());
  const currentView = view === "fading-out" ? "public" : view;

  // Toggle between public and admin
  const toggleView = (targetView) => {
    if (view === targetView) return;

    if (view === "public") {
      setView("fading-out");
      setTimeout(() => {
        window.location.hash = "admin-key-123";
        setView("admin");
      }, 500);
    } else {
      window.location.hash = targetView === "admin" ? "admin-key-123" : "";
      setView(targetView);
    }
  };

  // React to URL hash changes (admin/public)
  useEffect(() => {
    const handleHashChange = () => {
      const newView = getInitialView();
      if (view !== newView && view !== "fading-out") {
        setView(newView);
      }
    };
    window.addEventListener("hashchange", handleHashChange);
    return () => window.removeEventListener("hashchange", handleHashChange);
  }, [view]);

  // ------------------------------------------------------------
  // App Return: Routing and Layout
  // ------------------------------------------------------------
  return (
    <Router>
      <div className="font-sans">
        {/* Global CSS Variables for Theming */}
        <style jsx="true" global="true">{`
          :root {
            --arm-blue: ${ARM_BLUE};
            --arm-gold: ${ARM_GOLD};
            --soft-mint: ${SOFT_MINT};
          }
          .text-arm-blue {
            color: var(--arm-blue);
          }
          .bg-arm-blue {
            background-color: var(--arm-blue);
          }
          .text-arm-gold {
            color: var(--arm-gold);
          }
          .bg-arm-gold {
            background-color: var(--arm-gold);
          }
          .bg-soft-mint {
            background-color: var(--soft-mint);
          }
        `}</style>

        <Routes>
          {/* üè† Home + Admin Controlled View */}
          <Route
            path="/"
            element={
              currentView === "admin" ? (
                <AdminDashboard toggleView={toggleView} />
              ) : (
                <PageTransitionWrapper isPublic={view === "public"}>
                  <PublicView toggleView={toggleView} view={currentView} />
                </PageTransitionWrapper>
              )
            }
          />

          {/* üè¢ Company Profile ‚Äî Opens as Separate Page */}
          <Route path="/company-profile" element={<CompanyProfile />} />

          {/* üîê Admin Direct Route */}
          <Route
            path="/admin"
            element={<AdminDashboard toggleView={toggleView} />}
          />
        </Routes>
      </div>
    </Router>
  );
}
